        }
    ]
    return(
        <section id="why-section">
            <h1><span style={{color: "orange"}}>But,</span><br/>Why should you become a Mindful Marketer</h1>
            <div>
                {content.map((item, index )=>
                    <article key={index}>
                        <FontAwesomeIcon icon={item.icon}/>
                        <p>{item.text}</p>
                    </article>)}
            </div>
        </section>
    )
}

export default WhySection;
